import React, { PropTypes, Component } from 'react';
import AddAssetPage from './AddAsset.component';

const propTypes = {
  title: PropTypes.string,
  router: PropTypes.object
};

const defaultProps = {
  title: 'Add Asset'
};

class Page extends Component {
  render() {

    return (
      <div>
        <AddAssetPage title={this.props.title} router={this.props.router} />
      </div>
    );
  }
}

Page.propTypes = propTypes;
Page.defaultProps = defaultProps;

export default Page;
